const puppeteer = require('puppeteer');
const fs = require('fs');
const path = require('path');

async function extractInstagramReel() {
    const url = 'https://www.instagram.com/reels/DTTE7H2imEH/';
    const outputFile = path.join(process.cwd(), 'extracted_content', 'instagram_reel_transcript.txt');

    let browser;
    let output = [];

    try {
        console.log('Launching browser...');
        browser = await puppeteer.launch({
            headless: true,
            args: [
                '--no-sandbox',
                '--disable-setuid-sandbox',
                '--disable-dev-shm-usage',
                '--disable-accelerated-2d-canvas',
                '--disable-gpu',
                '--window-size=1920x1080',
                '--user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/120.0.0.0 Safari/537.36'
            ]
        });

        const page = await browser.newPage();

        // Set viewport
        await page.setViewport({ width: 1920, height: 1080 });

        console.log(`Navigating to ${url}...`);
        await page.goto(url, { 
            waitUntil: 'networkidle2',
            timeout: 30000 
        });

        // Wait a bit for content to load
        await page.waitForTimeout(3000);

        output.push('='.repeat(80));
        output.push('INSTAGRAM REEL CONTENT EXTRACTION');
        output.push('='.repeat(80));
        output.push(`URL: ${url}`);
        output.push(`Extracted at: ${new Date().toISOString()}`);
        output.push('='.repeat(80));
        output.push('');

        // Check for login wall
        const loginWallExists = await page.evaluate(() => {
            const text = document.body.innerText.toLowerCase();
            return text.includes('log in to continue') || 
                   text.includes('sign up') ||
                   document.querySelector('input[name="username"]') !== null;
        });

        if (loginWallExists) {
            console.log('Login wall detected, attempting to bypass...');
            output.push('NOTE: Login wall detected. Content may be limited.');
            output.push('');

            // Try to close any login modals
            try {
                const closeButtons = await page.$$('svg[aria-label="Close"], button[aria-label="Close"]');
                for (const button of closeButtons) {
                    await button.click().catch(() => {});
                    await page.waitForTimeout(1000);
                }
            } catch (e) {
                console.log('Could not close modal:', e.message);
            }
        }

        // Extract page title
        const pageTitle = await page.title();
        output.push('PAGE TITLE:');
        output.push(pageTitle);
        output.push('');

        // Try to extract username/author
        console.log('Extracting username...');
        const username = await page.evaluate(() => {
            // Try multiple selectors for username
            const usernameSelectors = [
                'a[role="link"] span',
                'header a',
                'h2 a',
                '[class*="Username"]'
            ];

            for (const selector of usernameSelectors) {
                const element = document.querySelector(selector);
                if (element && element.innerText && element.innerText.trim()) {
                    return element.innerText.trim();
                }
            }
            return null;
        });

        if (username) {
            output.push('USERNAME/AUTHOR:');
            output.push(username);
            output.push('');
        }

        // Extract caption text
        console.log('Extracting caption...');
        const caption = await page.evaluate(() => {
            // Try multiple methods to find caption
            const captionSelectors = [
                'h1',
                '[class*="Caption"]',
                'span[dir="auto"]',
                'div[role="button"] + span',
                'span:not([class])'
            ];

            const captions = [];

            for (const selector of captionSelectors) {
                const elements = document.querySelectorAll(selector);
                for (const el of elements) {
                    const text = el.innerText?.trim();
                    if (text && text.length > 20 && !captions.includes(text)) {
                        // Filter out likely non-caption text
                        if (!text.includes('Log in') && 
                            !text.includes('Sign up') &&
                            !text.match(/^\d+$/)) {
                            captions.push(text);
                        }
                    }
                }
            }

            return captions;
        });

        if (caption && caption.length > 0) {
            output.push('CAPTION TEXT:');
            caption.forEach((cap, i) => {
                if (i > 0) output.push('---');
                output.push(cap);
            });
            output.push('');
        } else {
            output.push('CAPTION TEXT:');
            output.push('(No caption text found)');
            output.push('');
        }

        // Look for transcript/subtitle text
        console.log('Searching for transcript/subtitles...');
        const transcriptText = await page.evaluate(() => {
            const transcriptSelectors = [
                '[class*="transcript"]',
                '[class*="subtitle"]',
                '[class*="caption"]',
                '[aria-label*="transcript"]',
                '[aria-label*="subtitle"]'
            ];

            const transcripts = [];

            for (const selector of transcriptSelectors) {
                const elements = document.querySelectorAll(selector);
                for (const el of elements) {
                    const text = el.innerText?.trim();
                    if (text && text.length > 0) {
                        transcripts.push(text);
                    }
                }
            }

            return transcripts.length > 0 ? transcripts : null;
        });

        if (transcriptText && transcriptText.length > 0) {
            output.push('TRANSCRIPT/SUBTITLES:');
            transcriptText.forEach((text, i) => {
                if (i > 0) output.push('---');
                output.push(text);
            });
            output.push('');
        } else {
            output.push('TRANSCRIPT/SUBTITLES:');
            output.push('(No transcript or subtitle text found)');
            output.push('');
        }

        // Extract visible comments
        console.log('Extracting comments...');
        const comments = await page.evaluate(() => {
            const commentElements = document.querySelectorAll('span[dir="auto"]');
            const comments = [];

            for (const el of commentElements) {
                const text = el.innerText?.trim();
                if (text && text.length > 10 && text.length < 500) {
                    // Try to avoid duplicates and UI elements
                    if (!text.includes('Log in') && 
                        !text.includes('Sign up') &&
                        !comments.includes(text)) {
                        comments.push(text);
                    }
                }
            }

            return comments.slice(0, 10); // Limit to first 10 comments
        });

        if (comments && comments.length > 0) {
            output.push('COMMENTS:');
            comments.forEach((comment, i) => {
                output.push(`${i + 1}. ${comment}`);
            });
            output.push('');
        } else {
            output.push('COMMENTS:');
            output.push('(No comments accessible without login)');
            output.push('');
        }

        // Extract all visible text as fallback
        console.log('Extracting all visible text...');
        const allText = await page.evaluate(() => {
            return document.body.innerText;
        });

        output.push('ALL VISIBLE TEXT (RAW):');
        output.push('-'.repeat(80));
        output.push(allText);
        output.push('-'.repeat(80));
        output.push('');

        // Take a screenshot for reference
        const screenshotPath = path.join(process.cwd(), 'extracted_content', 'instagram_reel_screenshot.png');
        await page.screenshot({ path: screenshotPath, fullPage: true });
        console.log(`Screenshot saved to: ${screenshotPath}`);
        output.push(`Screenshot saved to: ${screenshotPath}`);

    } catch (error) {
        console.error('Error during extraction:', error);
        output.push('');
        output.push('ERROR OCCURRED:');
        output.push(error.message);
        output.push('');
        output.push('Stack trace:');
        output.push(error.stack);
    } finally {
        if (browser) {
            await browser.close();
        }
    }

    // Write output to file
    const outputText = output.join('\n');
    fs.writeFileSync(outputFile, outputText, 'utf-8');
    console.log(`\nExtraction complete! Output saved to: ${outputFile}`);
    console.log(`\nPreview of extracted content:\n`);
    console.log(outputText.substring(0, 1000) + '...');

    return outputFile;
}

// Run the extraction
extractInstagramReel().catch(console.error);

